webpackJsonp([0x955097f9abbc],{8569:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"German Top 50 Blogparade",date:"01 Jun 2004",slug:"/2004-06-01-german-top-50-blogparade/",tags:"Y2004"},html:'<p>The Germano-blogo-philes in the audience might be interested in the <a href="http://www.m-e-x.de/blog/archive/001909.html">German Blogparade</a> that <a href="http://www.m-e-x.de/blog/">M-E-X</a> has extracted from <a href="http://www.technorati.com/">Technorati</a>. You\'ll probably find something new.</p>'},next:{fields:{title:"Converted",date:"31 May 2004",slug:"/2004-05-31-converted/"}},previous:{fields:{title:"Hamburger BlogGrill",date:"01 Jun 2004",slug:"/2004-06-01-hamburger-bloggrill/"}}},{node:{fields:{title:"Converted",date:"31 May 2004",slug:"/2004-05-31-converted/",tags:"Y2004"},html:'<p>I\'ve done it. Encouraged among other things by a persistent comment spammer, I\'ve now converted this blog to <a href="http://wordpress.org/">WordPress</a> 1.2. At the same time, my permalinks are now cool hyphenated-titles-like-<a href="http://weblog.burningbird.net/">Shelley</a>-and-<a href="http://diveintomark.org/">Mark</a>, so I must be cool now as well. Of course the old links are redirected... well, most of them anyway. And I wanted to redo the blogroll anyway, so that\'s missing for the moment. But otherwise things should pretty much look and work as before, unless you want to link a dozen times to a porn site in a comment. That won\'t work anymore.</p>'},next:{fields:{title:"Pentecost Singers",date:"30 May 2004",slug:"/2004-05-30-pentecost-singers/"}},previous:{fields:{title:"German Top 50 Blogparade",date:"01 Jun 2004",slug:"/2004-06-01-german-top-50-blogparade/"}}},{node:{fields:{title:"Pentecost Singers",date:"30 May 2004",slug:"/2004-05-30-pentecost-singers/",tags:"Y2004"},html:'<p><img alt="pent2004.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2004/05/pent2004.jpg" width="320" height="240" border="0" /></p>'},next:{fields:{title:"The Uschi Principle",date:"29 May 2004",slug:"/2004-05-29-the-uschi-principle/"}},previous:{fields:{title:"Converted",date:"31 May 2004",slug:"/2004-05-31-converted/"}}}],pathPrefix:"",first:!1,last:!1,index:476,pageCount:1101}}}});
